column8:
■製品特徴<br>◆補食に適した飲みきりサイズの125mlで200kcal摂取できます。<br>また、亜鉛・銅・ビタミン類・食物繊維を強化しています。<br>「免疫力」を意識して、モラック乳酸菌を1パックあたり、100億個配合しました。<br>◆ヨーグルト味、いちご味、バナナ味、コーンスープ味、みかん味、くり味、コーヒー味、ミルクティー味の全8種類。<br>後味すっきり、8種類の味で毎日飽きずに楽しめます。<br><br>◆こんな場合におすすめします<br>ハーフ食(※)に1パック！<br>エンジョイclimealを1パックプラスすることで、ハーフ食をさらに高栄養にすることができます。<br>●高齢などで食事が摂れない方に<br>●おやつやデザートとして<br>●不足しがちな微量元素や食物繊維の補給に<br>※ハーフ食とは<br>「喫食率アップ」「食事満足度の向上」「栄養状態の改善」を目指すため通常量の半分量とした食事のことです。<br><br>◆おすすめポイント<br>●1：脂肪エネルギー比率25％<br>日本人の食事摂取基準（2010年版）(※)に配慮したエネルギーバランスで長期飲用に適しています<br>※日本人の食事摂取基準（2010年版）.第一出版,2010.[50～69歳 男性]<br>●2：全8種類詰め合わせセットを用意しました。<br>6種類のフレーバーすべてを楽しめるいろいろセットもご用意しました<br>125ml×3パック×8種＝1ケース（当ページは2ケースセット）<br>【いろいろセット】<br>１ケースに、ヨーグルト味、いちご味、バナナ味、コーンスープ味、みかん味、くり味、コーヒー味、ミルクティー味が入ります。<br>●3：栄養機能食品（亜鉛・銅）<br>栄養機能食品とは、1日当たりの摂取目安量に含まれる栄養成分量が厚生労働大臣が定める規格基準に適合すれば、所定の栄養機能を表示することができる食品です。<br>亜鉛は、味覚を正常に保つのに必要な栄養素です。<br>亜鉛は、皮膚や粘膜の健康維持を助ける栄養素です。<br>亜鉛は、たんぱく質・核酸の代謝に関与して、健康の維持に役立つ栄養素です。<br>銅は、赤血球の形成を助ける栄養素です。<br>銅は、多くの体内酵素の正常な働きと骨の形成を助ける栄養素です。<br><br>■標準物性値<br>浸透圧（mOsm/kg H2O）580<br> 浸透圧（mOsm/l）440<br> pH（20℃）6.6<br> 比重（20℃）1.11<br> 粘度（mPa・s,20℃）27<br> <br>■主要原材料<br>デキストリン、乳たんぱく質、植物油、難消化性デキストリン、グラニュー糖、乾燥酵母、pH調整剤、香料、乳化剤、色素*、甘味料、（アセスルファムK、スクラロース）、グルコン酸亜鉛、グルコン酸銅<br>*プレーンには含まれません<br><br>■アレルギー情報<br>◆特定原材料：乳<br>◆特定原材料に準ずるもの：大豆<br> <br>■形状 液体<br><br>■保存方法 常温保存<br><br>■お召し上がり方<br>そのまま飲む<br><br>■たんぱく質量<br>7.5g/1本125ml<br><br>■賞味期限<br>製造日より270日<br><br>■標準組成表(エンジョイclimeaｌ125ml当たり)<br>エネルギー（kcal） 200<br>たんぱく質（g） 7.5（％エネルギー） 15<br> 脂質（g） 5.6（％エネルギー） 25<br> 炭水化物（g） 31.3（％エネルギー） 60<br> 糖質（g） 29.4<br>食物繊維（g） 1.9<br> 灰分（g） 1.0<br>水分（g） 94<br>ナトリウム（mg） 141<br> 食塩相当量※（g） 0.36<br> カリウム（mg） 179<br> 塩素（mg） 206<br> カルシウム（mg） 113<br> マグネシウム（mg） 44<br> リン（mg） 113<br> 鉄（mg） 1.5<br> 亜鉛（mg） 1.4<br> 銅（mg） 0.13<br> マンガン（mg） 0.23<br> ヨウ素（μg） 19<br> セレン（μg） 5<br> クロム（μg） 5<br> モリブデン（μg） 4<br> ビタミンA<br>       レチノール当量（μg） 124<br> レチノール（μg） 124<br>ビタミンD（μg） 0.7<br> ビタミンE<br>       α-トコフェロール（mg） 1.9<br> ビタミンK（μg） 11<br>ビタミンB1（mg） 0.19<br> ビタミンB2（mg） 0.21<br> ナイアシン（mg） 2.9<br> ナイアシン当量（mg） 4.4<br> ビタミンB6（mg） 0.30<br> ビタミンB12（μg） 0.45<br> 葉酸（μg） 60<br>パントテン酸（mg） 1.5<br> ビタミンC（mg） 15<br>ビオチン（μg） 6<br> ※：食塩相当量（g）＝ナトリウム（mg）×2.54×1/1000<br><br>■保管、使用上の注意<br>1.医師・栄養士等のご指導に従って使用してください。<br>2.静脈内等へは絶対に注入しないでください。<br>3.牛乳・大豆由来の成分が含まれています。アレルギーを示す方は使用しないでください。<br>4.水分管理、電解質及び亜鉛・銅等の微量元素の補給量に配慮して使用してください。<br>5.使用開始時は、少量または低濃度（0.5-1kcal/ml前後）とし、腹部症状等に注意しながら使用してください。<br>6.容器が落下・衝撃等により破損しますと、無菌性が損なわれます。取り扱いには十分注意してください。<br>7.容器は衛生的にお取り扱いください。<br>8.容器に漏れ・膨脹等がみられるもの及び容器の破損しているものはお飲みにならないでください。<br>9.食用酵母由来の沈澱、あるいは白色の浮遊物（脂肪）が認められる場合もありますが、品質には問題ありません。開封前によく振ってからお飲みください。<br>10.開封時に内容物の色・臭い・味に異常があるもの及び固まっているものはお飲みにならないでください。<br>11.沈澱・凝固の原因となりますので、本品に果汁等の酸性物質や多量の塩類等を混合しないでください。<br>12.電子レンジで加温しないでください。加温する場合は、未開封のままポリ袋に入れ、お湯（約60℃）で体温程度を目安に温めてください。<br> 長時間または繰り返しの加温は、風味劣化・褐色化・沈澱等の原因となりますので避けてください。<br>13.開封後に全量お飲みにならない場合には、直ちに冷蔵庫に保管し、その日のうちにお飲みください。<br>14.室温で保存できますが、おいしさを保つために冷所での保管をおすすめします。<br>15.直射日光があたる場所や、高温な場所、凍結するような場所で保管しますと、風味劣化等の性状変化が認められる場合があります。<br>16.1日当たり250ml（2パック）を目安にお召しあがりください。<br>17.本品は、多量摂取により疾病が治癒したり、より健康が増進するものではありません。<br> 亜鉛の摂りすぎは、銅の吸収を阻害するおそれがありますので、過剰摂取にならないよう注意してください。<br>1日の摂取目安量を守ってください。乳幼児・小児は本品の摂取を避けてください。<br>18.本品は、特定保健用食品と異なり、消費者庁長官により個別審査を受けたものではありません。<br><br>■お問い合わせ<br>こちらの商品につきましては、当店(ドラッグピュア）または下記へお願いします。<br>株式会社クリニコ<br>東京都目黒区目黒4-4-22<br>TEL:0120-52-0050<br>受付時間:平日9:00～17:30（土曜・日曜・祝日を除く）<br><br><br>広告文責：株式会社ドラッグピュア<br>作成：201509SN<br>神戸市北区鈴蘭台北町1丁目1-11-103<br>TEL:0120-093-849<br>製造・販売元：株式会社クリニコ<br>区分：介護向け栄養補助食品・日本製<br><br><br><font color="#cc0000"> ■ <b>関連商品</b></font><br> <style type="text/css"> <!-- .u1 { list-style-image: url(http://image.rakuten.co.jp/drugpure/cabinet/signboard/list-red.gif);margin: 0 0 0 20px; padding: 0;} --> </style> <ul class="u1"><li>クリニコ　エンジョイシリーズ</li><li>クリニコお取扱い商品</li></ul><style type="text/css">
